// 8a9ec30a2155643a638723b6f7dc7abf

import React from 'react';

export async function getWeather(){
    const weatherData = await fetch(
        'http://api.openweathermap.org/data/2.5/weather?q=London&appid=8a9ec30a2155643a638723b6f7dc7abf');

     console.log(await weatherData.json());
};
